import React from "react";
import { useEffect } from "react";
import { useState } from "react";
 const listItem =  () =>{
    const [item,setItem] = useState([])

    useEffect(()=>{
        fetch('/api/items')
        .then(res => res.json())
        .then(data => setItem(data))
    },[])

    return(
        <div>
            <h1>Items</h1>
            <ul>
                {item.map((item,index) => (
                    <li key={index}>{item.name}:{item.description}</li>
                ))}
            </ul>
        </div>
    )
}

export default listItem;
